<role>
You are a meticulous data analyst AI. Your primary function is to accurately analyze structured data and provide precise, verifiable answers.

</role>

<format>
You will be given a dataset with two key parts:

A 'questions' section: This is your data dictionary or schema. It is the single source of truth for understanding what each field and score means. Refer to it carefully.

A 'responses' section: This contains the raw data from each individual respondent.

To answer the question correctly, you must first use the 'questions' schema to fully understand the context and meaning of the data points within the 'responses'. Do not rely on any prior knowledge outside of this provided data. Base your entire analysis on the information given.

</format>

<output>
Provide your final answer directly and concisely. Output must be the human-readable value, not an option code.

Rules:
- For MCQ fields, map any letter codes in the Responses (case-insensitive) to the corresponding option text from the Questions schema, and output only that text. Do NOT include the letter or both.
  Example: If the schema is ""[MCQ: A. Abnormal B. Inconclusive C. Normal]"" and the response is ""a"", output ""Abnormal"".
- For open-ended fields, output the exact text value.
- If the question asks for a count, provide only the number (e.g., ""42"").
- If the question asks for a list of names or IDs, provide a simple comma-separated list (e.g., ""17, 21, 23"").
- Preserve capitalization exactly as in the schema (e.g., output ""Abnormal"", not ""abnormal"" or ""A"").

</output>

<task>
Count the respondents with a 'Life satisfaction' of 5 or higher.
</task>"

questionnaire:
"@prefix : <http://example.org/survey#> .
@prefix pred: <http://example.org/predicate#> .
@prefix qg: <http://example.org/question_group#> .

# Questions
:QYear_of_birth pred:Text ""What is your date of birth? [Open-ended]"" .
:QGender pred:Text ""What is your gender? [MCQ: 1. Male 2. Female]"" .
:QSocio_economic_status pred:Text ""What is the socio-economic status of your home? [Likert 1–6: 1 = Very low, 6 = Very high]"" .
:QEthnic_identity pred:Text ""According to your culture, people, or physical features, you are or are recognized as: [MCQ: 1. Indigenous 2. Gypsy 3. Raizal from San Andres, Providencia and Santa Catalina Archipelago 4. Palenquero from San Basilio 5. Black, mulatto (Afro-descendant), Afro-Colombian 6. None of the above]"" .

:QGParental_Education pred:BaseQuestion ""How many years of education did your parents receive? [Open-ended]"" ;
    qg:hasSubQuestion :QParental_Education_Father, :QParental_Education_Mother .
:QParental_Education_Father pred:Text ""Father?"" .
:QParental_Education_Mother pred:Text ""Mother?"" .

:QLife_satisfaction pred:Text ""In general, how satisfied are you with all aspects of your life? [Likert 0–10: 0 = Not satisfied, 10 = Totally satisfied]"" .
:QHappiness pred:Text ""How happy did you feel yesterday? [Likert 0–10: 0 = At no time, 10 = All the time]"" .
:QLaughter pred:Text ""How much did you laugh yesterday? [Likert 0–10: 0 = At no time, 10 = All the time]"" .
:QLearning pred:Text ""Did you learn new or exciting things yesterday? [Likert 0–10: 0 = At no time, 10 = All the time]"" .
:QEnjoyment pred:Text ""How much did you enjoy the activities you did yesterday? [Likert 0–10: 0 = At no time, 10 = All the time]"" .
